import background from "./background-pattern-desktop.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <div className="img-container">
        <img
          src={background}
          alt="purple background with swirly lines"
          className="image-fluid"
        />
      </div>
    </div>
  );
}

export default App;
